import React, { useEffect, useState } from "react";
import Post from "./Post";


function List() {

  const [isLoading, setIsLoading] = useState(true)

  const posts = () => {
    let posts = fetch('https://listnotes.forgiveandforget.workers.dev/').then(
      result => result.json()
    ).catch(
      (err) => console.log("An error occured. Error: ", err)
    )

    return posts
  }

  return (
    <ul>
      {
        posts.forEach(post => <Post />)
      }
    </ul>
  );
}

export default List;
